import ExpenseItem from "./Components/ExpenseItem";
function App() {
  const expenses = [
    {
      id: "e1",
      title: "Netflix Subscription",
      amount: 599,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 799.49,
      date: new Date(2021, 2, 12),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 3000,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 2000,
      date: new Date(2021, 5, 12),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>

      {expenses.map((e) => (
        <ExpenseItem
          title={e.title}
          date={e.date}
          price={e.amount}
        ></ExpenseItem>
      ))}
    </div>
  );
}

export default App;
